var pi_99k = '';
var e_100k = '2.'

var cur = 0;
var deg = 0;
var r, g, b;
var X = window.innerWidth;
var Y = window.innerHeight;

var pic, nums;

window.addEventListener('load', function() { start(); }, false);

function start() {
  pic = Raphael([0, 0, X, Y, {
    type: "text",
    x: X/2,
    y: Y/3,
    text: "\u03C0"
  }]);

  pic.attr(
    {"font-family":"irrational",
     "font-size":"600"}
     );

  nums = window.document.getElementById('numbers');
  
  rotate();
  makePiImage();
}

function makePiImage() {
  r = parseInt(pi_99k.substring(cur, cur+3));
  cur += 3;
  g = parseInt(pi_99k.substring(cur, cur+3));
  cur += 3;
  b = parseInt(pi_99k.substring(cur, cur+3));
  cur += 3;

  var color = Raphael.rgb(r%256, g%256, b%256);
  changeBackground(color);

  var des = zfill(r,3) + "      " + zfill(g,3) + "      " + zfill(b,3);
  nums.innerHTML = des;

  setTimeout(makePiImage, 300);
}

function rotate() {
  pic.transform("r" + deg);
  deg += 3;

  setTimeout(rotate, 15);
}

function changeBackground(color) {
  document.body.style.background = color;
}

function zfill(number, size) {
  number = number.toString();
  while (number.length < size) number = "0" + number;
  return number;
}